import { Link } from "react-router-dom";

const NotFound = () => {
  return (
    <div className="not-found">
      <h2 className="text-danger">404 - Not Found</h2>
      <p className="lead">Oops! Looks like the page you are looking for does not exist.</p>
      <p className="text-muted">The page you requested could not be found. Please check the URL or navigate back to the homepage.</p>
      <Link to="/" className="btn btn-primary">Back to Homepage</Link>
    </div>
  );
};

export default NotFound;
